use criterion::{black_box, criterion_group, criterion_main, Criterion};
use weval::eval_float64;
use weval::tokenizer;

fn tokenizer_benchmark(c: &mut Criterion) {
    c.bench_function("run_tokenizer_shallow", |b| {
        b.iter(|| tokenizer(black_box(get_shallow_expression_str())))
    });
    c.bench_function("run_tokenizer_deep", |b| {
        b.iter(|| tokenizer(black_box(get_deep_expression_str())))
    });
    c.bench_function("run_tokenizer_shallow_and_deep", |b| {
        b.iter(|| tokenizer(black_box(get_shallow_and_deep_expression_str())))
    });
}

fn eval_float64_benchmark(c: &mut Criterion) {
    c.bench_function("run_eval_float64_shallow", |b| {
        b.iter(|| eval_float64(black_box(get_shallow_expression_str())))
    });
    c.bench_function("run_eval_float64_deep", |b| {
        b.iter(|| eval_float64(black_box(get_deep_expression_str())))
    });
    c.bench_function("run_eval_float64_shallow_and_deep", |b| {
        b.iter(|| eval_float64(black_box(get_shallow_and_deep_expression_str())))
    });
}

criterion_group!(benches, tokenizer_benchmark, eval_float64_benchmark);

criterion_main!(benches);

